import React from "react";
import html from "./icons/html.svg";
import css from "./icons/css.svg";
import js from "./icons/js.svg";
import c from "./icons/c.svg";
import java from "./icons/java.svg";
import python from "./icons/python.svg";
import php from "./icons/php.svg";
import sql from "./icons/sql.svg";
import jquery from "./icons/jquery.svg";
import git from "./icons/git.svg";
import github from "./icons/github.svg";
import vscode from "./icons/vscode.svg";
import flutter from "./icons/flutter.svg";
import firebase from "./icons/firebase.svg";
import mongodb from "./icons/mongodb.svg";
import react from "./icons/react.svg";
import node from "./icons/node.svg";
import ubuntu from "./icons/ubuntu.svg";
import bootstrap from "./icons/bootstrap.svg";
import photoshop from "./icons/photoshop.svg";
import premiere from "./icons/premiere.svg";
import windows from "./icons/windows.svg";
import xampp from "./icons/xampp.svg";
import studio from "./icons/studio.svg";

const Skills = () => {
    return (
        <>
            <section className="header">
                <div className="container">
                    <div className="row justify-content-center">
                        <div className="col-xs-3 col-sm-2 col-md-3 k-hover">
                            <img src={html} alt="html" title="HTML" className="skill_icon"/>
                        </div>
                        <div className="col-xs-3 col-sm-2 col-md-3 k-hover">
                            <img src={css} alt="css" title="css" className="skill_icon"/>
                        </div><div className="col-xs-3 col-sm-2 col-md-3 k-hover">
                            <img src={js} alt="js" title="js" className="skill_icon"/>
                        </div><div className="col-xs-3 col-sm-2 col-md-3 k-hover">
                            <img src={jquery} alt="jquery" title="jquery" className="skill_icon"/>
                        </div>
                    </div>
                </div>
            </section>
        </>
    );
};

export default Skills;
